import React from 'react';
import ReactDOM from 'react-dom/client';
import { ReactKeycloakProvider } from '@react-keycloak/web';
import keycloak, { initKeycloak, logout } from './keycloak';
import App from './App';
import axios from 'axios';

// Configure axios defaults
axios.defaults.baseURL = 'http://localhost:8080';

// Ensure URL is a string
const ensureStringUrl = (url) => {
    if (typeof url === 'string') {
        return url;
    }
    if (url instanceof URL) {
        return url.toString();
    }
    if (typeof url === 'object' && url.origin) {
        return `${url.origin}${url.pathname || ''}`;
    }
    console.warn('Invalid URL format:', url);
    return window.location.origin;
};

const renderError = (error) => {
    // Ensure error is an object
    const errorObj = error || {};

    const root = ReactDOM.createRoot(document.getElementById('root'));
    root.render(
        <div style={{
            padding: '20px',
            fontFamily: 'Arial',
            maxWidth: '800px',
            margin: '0 auto',
            textAlign: 'center'
        }}>
            <h1 style={{ color: '#d32f2f' }}>Authentication Service Unavailable</h1>
            <p>We're unable to connect to the authentication service.</p>

            <div style={{
                backgroundColor: '#ffebee',
                padding: '20px',
                borderRadius: '8px',
                margin: '20px 0',
                textAlign: 'left'
            }}>
                <h3>Error Details:</h3>
                <p><strong>Message:</strong> {errorObj.message || 'Unknown error'}</p>
                <p><strong>Details:</strong> {errorObj.details || 'No details available'}</p>
                <p><strong>Keycloak URL:</strong> {errorObj.config?.url || 'Not available'}</p>
                <p><strong>Realm:</strong> {errorObj.config?.realm || 'Not available'}</p>
                <p><strong>Client ID:</strong> {errorObj.config?.clientId || 'Not available'}</p>
                <p><strong>Redirect URI:</strong> {errorObj.config?.redirectUri || 'Not available'}</p>
                <p><strong>CORS Enabled:</strong> {errorObj.config?.cors ? 'Yes' : 'No'}</p>
                <p><strong>CORS Origins:</strong> {Array.isArray(errorObj.config?.corsOrigins) ? errorObj.config.corsOrigins.join(', ') : 'Not configured'}</p>
            </div>

            {errorObj.serverUnavailable && errorObj.suggestions && (
                <div style={{
                    backgroundColor: '#e8f5e9',
                    padding: '20px',
                    borderRadius: '8px',
                    margin: '20px 0',
                    textAlign: 'left'
                }}>
                    <h3>Troubleshooting Suggestions:</h3>
                    <ul style={{ listStyleType: 'disc', paddingLeft: '20px' }}>
                        {errorObj.suggestions.map((suggestion, index) => (
                            <li key={index}>{suggestion}</li>
                        ))}
                    </ul>
                </div>
            )}

            <div style={{
                backgroundColor: '#f5f5f5',
                padding: '20px',
                borderRadius: '8px',
                margin: '20px 0',
                textAlign: 'left'
            }}>
                <h3>Debug Information:</h3>
                <p><strong>Current Time:</strong> {new Date().toLocaleString()}</p>
                <p><strong>Window Origin:</strong> {window.location.origin}</p>
                <p><strong>Browser:</strong> {navigator.userAgent}</p>
                <p><strong>React App Port:</strong> 4200</p>
            </div>

            <div style={{
                backgroundColor: '#fff3e0',
                padding: '20px',
                borderRadius: '8px',
                margin: '20px 0',
                textAlign: 'left'
            }}>
                <h3>Keycloak Configuration Checklist:</h3>
                <ul style={{ listStyleType: 'disc', paddingLeft: '20px' }}>
                    <li>Keycloak server running at http://localhost:9090</li>
                    <li>Realm "whatsapp-clone" exists</li>
                    <li>Client "whatsapp-clone-app" exists</li>
                    <li>Client has "public" access type</li>
                    <li>Client has "http://localhost:4200/*" in Valid Redirect URIs</li>
                    <li>Client has "http://localhost:4200" in Web Origins</li>
                </ul>
            </div>

            <div style={{ display: 'flex', justifyContent: 'center', gap: '10px' }}>
                <button
                    onClick={() => window.location.reload()}
                    style={{
                        padding: '12px 24px',
                        marginTop: '20px',
                        backgroundColor: '#1976d2',
                        color: 'white',
                        border: 'none',
                        borderRadius: '4px',
                        cursor: 'pointer',
                        fontSize: '16px'
                    }}
                >
                    Retry
                </button>
                <button
                    onClick={() => {
                        // Clear tokens and reload
                        try {
                            // Clear any Keycloak-related items
                            Object.keys(localStorage).forEach(key => {
                                if (key.startsWith('kc-') || key.includes('keycloak')) {
                                    localStorage.removeItem(key);
                                }
                            });

                            // Clear session storage items too
                            Object.keys(sessionStorage).forEach(key => {
                                if (key.startsWith('kc-') || key.includes('keycloak')) {
                                    sessionStorage.removeItem(key);
                                }
                            });

                            console.log('Cleared existing Keycloak tokens');
                        } catch (e) {
                            console.error('Failed to clear tokens:', e);
                        }
                        window.location.reload();
                    }}
                    style={{
                        padding: '12px 24px',
                        marginTop: '20px',
                        backgroundColor: '#f44336',
                        color: 'white',
                        border: 'none',
                        borderRadius: '4px',
                        cursor: 'pointer',
                        fontSize: '16px'
                    }}
                >
                    Clear Tokens & Retry
                </button>
            </div>
        </div>
    );
};

const initApp = async () => {
    try {
        console.log('Starting Keycloak initialization...');
        // Try to initialize with force refresh if needed
        const keycloakInstance = await initKeycloak(false);

        console.log('Keycloak initialized, authenticated:', keycloakInstance.authenticated);

        if (!keycloakInstance.authenticated) {
            console.log('Not authenticated, redirecting to login...');
            await keycloakInstance.login();
            return; // Login will redirect, so we don't need to continue
        }

        // Configure axios with token refresh
        axios.interceptors.request.use(async (config) => {
            if (keycloakInstance.authenticated) {
                try {
                    // Only refresh token if it's close to expiration
                    const tokenExpired = keycloakInstance.isTokenExpired(30); // 30 seconds buffer
                    if (tokenExpired) {
                        console.log('Token expired or about to expire, refreshing...');
                        await keycloakInstance.updateToken(70);
                    }

                    // Add the token to the request
                    const token = keycloakInstance.token;
                    if (token) {
                        config.headers.Authorization = `Bearer ${token}`;
                        console.log('Added token to request');
                    }
                } catch (error) {
                    console.error('Failed to refresh token:', error);
                    // Force login if token refresh fails
                    keycloakInstance.login();
                }
            }
            return config;
        }, (error) => {
            console.error('Axios request interceptor error:', error);
            return Promise.reject(error);
        });

        // Add response interceptor for 401 errors
        axios.interceptors.response.use(
            (response) => response,
            async (error) => {
                if (error.response && error.response.status === 401) {
                    console.log('Received 401 response, refreshing token...');
                    try {
                        await keycloakInstance.updateToken(70);
                        // Retry the request with the new token
                        const originalRequest = error.config;
                        originalRequest.headers.Authorization = `Bearer ${keycloakInstance.token}`;
                        return axios(originalRequest);
                    } catch (refreshError) {
                        console.error('Token refresh failed after 401:', refreshError);
                        // Redirect to login if refresh fails
                        keycloakInstance.login();
                    }
                }
                return Promise.reject(error);
            }
        );

        // Render app only after Keycloak is initialized
        const root = ReactDOM.createRoot(document.getElementById('root'));
        root.render(
            <ReactKeycloakProvider 
                authClient={keycloakInstance}
                initOptions={{ 
                    onLoad: 'check-sso', // Use check-sso here since we're already authenticated
                    checkLoginIframe: false,
                    pkceMethod: 'S256',
                    enableLogging: true
                }}
                onEvent={(event, error) => {
                    console.log('Keycloak event:', event, error || '');
                    if (event === 'onAuthError' || event === 'onAuthLogout') {
                        // Handle authentication errors
                        console.error('Authentication error or logout:', error);
                    }
                }}
                loadingComponent={<div>Loading authentication...</div>}
            >
                <App />
            </ReactKeycloakProvider>
        );
    } catch (error) {
        console.error('Failed to initialize app:', error);
        renderError(error);
    }
};

// Start the app
initApp();
